import React from "react";
import "../css/"

const PlanBanner = ({ positions }) => {

    return (
        <React.Fragment>
            <div className="banner_wrap">
                {positions.length > 0 && (<p>{positions[0].title}</p>)}
                {positions.map((position, index) => (
                    <div key={index}>
                        <p>{position.name}</p>
                        <p>{position.memo}</p>
                    </div>
                ))}
            </div>
        </React.Fragment>
    )
}

export default PlanBanner;
